import React from 'react'
import Login from './Login/Login'
import "./app.css"

import { Route ,Routes} from 'react-router'
export default function App() {
  return (
    <>
    <Routes >

      <Route path='/' element={<Login />} />

    </Routes>
    </>
  )
}
